import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Jumbotron } from 'react-bootstrap';


export default function Jumb(){
    return(
        <>
            <Jumbotron>

                <h1>Bem vindo!</h1>

                <h4>
                    Esse é o meu site onde mostro um pouco dos meus serviços.
                </h4>

            </Jumbotron>
        </>
    );
}
